import React from 'react';
import {
    FaArrowLeft,
    FaArrowRight,
    FaSearch
}from "react-icons/fa";

const Dashboard = () => {
    return (
        <div>
            <div class="topnav">
                <i href="#" ><FaArrowLeft/></i>
                <a href="#" class="RedoButton"><FaArrowRight/></a>
                <div class="searchbar">
                    <p><FaSearch/> Search</p>
                </div>
            </div>

            <div class="content">
                <h1>Dashboard page</h1>
            </div>
        </div>
    );
};

export default Dashboard;
